import logo from './quotation.svg';
import './App.css';
import React from 'react'
import { Redirect } from 'react-router-dom'

function App() {

  state = {
    redirect: false
  }

  setRedirect = () => {
    this.setState({
      redirect: true
    })
  }

  renderRedirect = () => {
    if (this.state.redirect) {
      return <Redirect to='/Main.js' />
    }
  }

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Welcome to QuoteBank!
        </p>
        <div>
        {this.renderRedirect()}
        <button onClick={this.setRedirect}>Enter</button>
       </div>
      </header>
    </div>
  );
}

export default App;
